// username 和 password
let yourStudentId = '';
let yourPassword = '';


// 关闭窗口的函数
let close = function() {
    window.location.href = 'about:blank';
    window.close();
}

// 进入统一身份认证界面
if(document.querySelector('.ty_btn') !== null) {
    (function() {
        document.querySelector('.ty_btn').click();
    })();
}

// 进入学工平台
if(document.querySelector('.login_box_landing_btn') !== null) {
    (function() {
        document.querySelector('#username').value = yourStudentId;
        document.querySelector('#password').value = yourPassword;
        document.querySelector('.login_box_landing_btn').click();
    })();
}

// 进入每日上报
if(document.querySelector('.blnr') !== null) {
    (function() {
        document.querySelectorAll('.blnr')[1].click()
    })();
}

// 提交每日一报
if(document.querySelector('.submit').innerText !== '已提交') {
    (function() {
        document.getElementsByTagName('a')[0].click(); // 获取地理位置,响应较长，提前执行
        setTimeout(()=>{
            document.querySelector('#dqzt').value = '其他'; // 当前状态
            document.querySelector('#txfscheckbox').checked = true // 勾选承诺
            document.getElementsByClassName('submit')[0].click(); // 提交
        }, 4000);
    })();
}

